def frequency(lst):
    """This function takes a list as input and returns a dictionary containing the frequency of each element in the list.

    The function works by creating an empty dictionary and then iterating through the list. For each element in the list, the function checks if the element is already in the dictionary. If it is, the function increments the value for that element by 1. If it is not, the function adds the element to the dictionary with a value of 1.

    Finally, the function returns the dictionary.
    """

    frequency_dict = {}

